import React from 'react'
const skills = [
    { id: 1, title: "HTML", progress: 80 },
    { id: 2, title: "CSS", progress: 40 },
    { id: 3, title: "JAVASCRIPT/REACT", progress: 80 },
    { id: 4, title: "PHP/LARAVEL", progress: 55 }
]

let styles={}
skills.forEach(x=>{
    styles[x.title]={
        width: "95%",
        display: "flex",
        flexDirection: "column",
        height:"fit-content",
        backgroundColor: "rgb(73 101 82 / 27%)"
    }
})

function MySkills() {
    return (
        <div className="my-skills">
            <div>
                <h1>My Skills</h1>
            </div>
            <div className="line"></div>
            {
                skills.map(x => (
                    <div className="skills" key={x.id}>
                        <div>
                            {x.title}
                        </div>
                        <div className={styles[x.title]}>
                            <div className="progress-bar">
                                {x.progress}%
                            </div>
                        </div>
                    </div>
                ))
            }

        </div>
    )
}

export default MySkills
